import classes from './contact.module.css'
import Pageheader from '../pageheader/pageheader';
import githubmark from '/Users/nonor/Dev/portfolio/src/img/githubmark.png';
import linkedin from '/Users/nonor/Dev/portfolio/src/img/linkedin.png';

const Contact = () => {
    return ( 
        <div className={classes.Container} id="contact">
            <Pageheader title={'Contact & liens utiles'}/>
            <img className={classes.Github} src={githubmark} alt="githubmark"></img>
            <img className={classes.Linkedin} src={linkedin} alt="linkedin"></img>
        </div>
     );
}

export default Contact;
